import React, { Component } from "react";
import Houses from "./Houses";
import "./styles.css";
import House from "./House";
import Character from "./Character";

class App extends Component {

  houses = Houses.map(e => {
    <House houseName={e.houseName} houseImgSrc={e.imgSrc} founder={e.founder} element={e.element} 
    />
  });

  render() {
    return (
        <div>
        <div>

        {this.houses} 
        </div>

        </div>

    );
}
}
export default App;
